rt-4161-4164-1-test(node:class benchmark-test)
    errobj: class error;
    process-status: float;
    test-code: text;
    instr: text;
    i: integer;
    cnt: integer;
    result: text;
    expected: text;
    connects: integer;
 begin
    test-code = "4161-1";

  // Start test application
    process-status = call start-test-app(test-code);
 
   // Establish GSI connection
    connects = 10;
    repeat
        change the text of the gsi-connection-configuration of rpc-interface to "tcp-ip host @"localhost@" port-number 24161";
        wait for 1 second;
        exit if the gsi-interface-status of rpc-interface = 2;
        connects = connects - 1;
        exit if connects = 0;
    end;
 
   // Check GSI connection
    if the gsi-interface-status of rpc-interface /= 2 then
    begin
       // stop test application
        start g2-kill-process(process-status);
        wait for 2 second;
       // return error
        call fail(node, "Could not connect GSI");
        return;
    end;
      
    instr = "hello";
    cnt = 3;
 
   // Call functions
    result = call test-func(cnt, instr) across rpc-interface;
    call simple-func() across rpc-interface;
    wait for 2 second;

   // Stop test application
    start rpc-exit() across rpc-interface;
    call g2-kill-process(process-status);
    wait for 2 second;
 
   // Make expected value
    expected = "";
    repeat
        expected = "[expected][instr]";
        cnt = cnt - 1;
        exit if cnt = 0;
    end;   
 
   // Check result
    if result = expected then
        call pass(node)
    else
        call fail(node, "Result ([result]) not equal expected([expected])");

end

start-test-app(test-code: text) = (float)
    process-status: float;
    process-exists: truth-value;
    cmd-line: text;
begin
    cmd-line = call get-cmd-line(test-code);

    process-status = call g2-spawn-process-to-run-command-line(cmd-line);
    if process-status = -1 then
    repeat
        wait for 1 second;
        process-exists = call g2-process-exists(process-status);
        exit if process-exists = false;
    end;
    return process-status;
end

get-cmd-line(test-code: text) = (text)
    operating-system: symbol;
    cmd-line: text;
begin
    operating-system = call g2-type-of-file-system();

    if operating-system = symbol("WIN32") then
        cmd-line ="C:\G2\src\g2fasth\bin\Release\rpc_test 2[test-code] [test-code] 30 > C:\G2\results\rpc[test-code].log"
    else
        cmd-line = "/gensym/src/g2fasth/bin/rpc_test 2[test-code] [test-code] 30 > /gensym/results/rpc[test-code].log";

    return cmd-line; 
end

